import collections
import matplotlib.pyplot as plt
import numpy as np

def create_histogram(strings_list, token_type, display_full_range=False, title="COmparaison"):
    token_values = []
    token_ranges = {'n': 128, 'd': 96, 't': 192, 'v': 128}

    for string in strings_list:
        if string[0] == token_type:
            token_values.append(int(string[1:]))

    counter = collections.Counter(token_values)

    if display_full_range:
        for i in range(token_ranges[token_type]):
            counter[i] += 0
    
    total = sum(counter.values())
    normalized_values = [value / total for value in counter.values()]

    plt.bar(counter.keys(), normalized_values)
    plt.xlabel(f"Valeurs de {token_type}")
    plt.ylabel("Fréquence")
    plt.title(f"Histogramme des mots de type {token_type}")
    plt.show()

import numpy as np
import matplotlib.pyplot as plt

def compare_histograms(strings_list1, strings_list2, token_type, display_full_range=False, title1="", title2="", color1='b', color2='r'):
    token_values1 = []
    token_values2 = []
    token_ranges = {'n': 128, 'd': 96, 't': 192, 'v': 128}
    total1 = 0
    total2 = 0
    
    for string in strings_list1:
        if string[0] == token_type:
            token_values1.append(int(string[1:]))
            total1 += 1

    for string in strings_list2:
        if string[0] == token_type:
            token_values2.append(int(string[1:]))
            total2 += 1

    hist1 = [0] * token_ranges[token_type]
    hist2 = [0] * token_ranges[token_type]

    for el in token_values1:
        hist1[el] += 1
    for el in token_values2:
        hist2[el] += 1
    
    hist1 = [el / total1 for el in hist1]
    hist2 = [el / total2 for el in hist2]

    width = 0.4
    ind = np.arange(token_ranges[token_type])

    # Create subplots
    fig, (ax1, ax2) = plt.subplots(2, 1, sharex=True)

    ax1.bar(ind, hist1, width, color=color1,  label="Morceau Runnin'Wild de Benny Goodman")
    ax2.bar(ind, hist2, width, color=color2, label="Génération avec une température de 0.75")

    ax1.set_title(title1)
    ax2.set_title(title2)
    ax1.set_ylabel("Fréquence d'apparition")
    ax2.set_ylabel("Fréquence d'apparition")
    ax1.legend()
    ax2.legend()
    plt.xlabel(f"Valeurs de {token_type}")
    
    plt.show()


def compare_histograms3(strings_list1, strings_list2, strings_list3, token_type, display_full_range=False, title1="", title2="", title3="", color1='b', color2='r', color3='g'):
    token_values1 = []
    token_values2 = []
    token_values3 = []
    token_ranges = {'n': 128, 'd': 96, 't': 192, 'v': 128}
    total1 = 0
    total2 = 0
    total3 = 0
    
    for string in strings_list1:
        if string[0] == token_type:
            token_values1.append(int(string[1:]))
            total1 += 1

    for string in strings_list2:
        if string[0] == token_type:
            token_values2.append(int(string[1:]))
            total2 += 1

    for string in strings_list3:
        if string[0] == token_type:
            token_values3.append(int(string[1:]))
            total3 += 1

    hist1 = [0] * token_ranges[token_type]
    hist2 = [0] * token_ranges[token_type]
    hist3 = [0] * token_ranges[token_type]

    for el in token_values1:
        hist1[el] += 1
    for el in token_values2:
        hist2[el] += 1
    for el in token_values3:
        hist3[el] += 1

    hist1 = [el / total1 for el in hist1]
    hist2 = [el / total2 for el in hist2]
    hist3 = [el / total3 for el in hist3]

    width = 0.4
    ind = np.arange(token_ranges[token_type])

    # Create subplots
    fig, (ax1, ax2, ax3) = plt.subplots(3, 1, sharex=True)

    ax1.bar(ind, hist1, width, color=color1,  label="Morceau Runnin'Wild de Benny Goodman")
    ax2.bar(ind, hist2, width, color=color2, label="Génération avec une température de 0.5")
    ax3.bar(ind, hist3, width, color=color3, label="Génération avec une température de 1.5")

    ax1.set_title(title1)
    ax2.set_title(title2)
    ax3.set_title(title3)
    ax1.set_ylabel("Fréquence \n d'apparition")
    ax2.set_ylabel("Fréquence \n d'apparition")
    ax3.set_ylabel("Fréquence \n d'apparition")
    ax1.legend()
    ax2.legend()
    ax3.legend()
    plt.xlabel(f"Valeurs de {token_type}")
    
    plt.tight_layout() # Use tight layout to ensure the subplots do not overlap
    plt.show()


